import logging
from datetime import datetime
import os

class Logger:
    def __init__(self, filename):
        self.logger = logging.getLogger('system_logger')
        self.logger.setLevel(logging.INFO)
        self.handler = logging.FileHandler(filename)
        self.handler.setFormatter(logging.Formatter('%(asctime)s - %(name)s - %(levelname)s - %(message)s'))
        self.logger.addHandler(self.handler)

    def log_message(self, message):
        self.logger.info(message)


class BrokerValidationRules:
    def __init__(self):
        self.rules = {}

    def update_rule(self, rule_id, rule):
        self.rules[rule_id] = rule

    def get_rule(self, rule_id):
        return self.rules.get(rule_id)


class TransactionManager:
    def __init__(self):
        self.transactions = set()

    def add_transaction(self, transaction_id):
        if transaction_id not in self.transactions:
            self.transactions.add(transaction_id)
            return True
        return False


class DFileGenerator:
    def __init__(self):
        self.requests = []

    def add_request(self, request):
        self.requests.append(request)

    def generate_files(self):
        for request in self.requests:
            filename = f"{request['filename']}_{datetime.now().strftime('%Y%m%d%H%M%S')}.txt"
            with open(os.path.join('d_files', filename), 'w') as f:
                f.write(request['content'])
            print(f"File {filename} generated")


